import React from "react";

export default function SideNav(props) {
  return (
    <ul>
      <li onClick={()=>{props.change("INBOX")}}>Inbox</li>
      <li onClick={()=>{props.change("TODAY")}}>Today</li>
      <li onClick={()=>{props.change("NEXT")}}>Next 7 days</li>
    </ul>
  );
}
